INSERT INTO `wp_posts` VALUES (19,1,'2023-09-02 18:12:58','2023-09-02 12:42:58','This cozy fleece crew has extra leeway in the shoulders, chest, and body for effortless comfort and a relaxed, vintage-inspired look. The stretchy ribbed openings give the crew a secure fit and a high-end feel. The left chest\'s embroidered Swoosh gives you a polished, carefree look.\r\n\r\n&nbsp;','Nike Solo Swoosh','Feel good and flex your fit while being at your maximum comfort level\r\n<ul>\r\n 	<li>100 % Cotton</li>\r\n 	<li>Soft</li>\r\n 	<li>Double layered</li>\r\n</ul>','publish','open','closed','','nike-solo-swoosh','','','2023-09-04 15:31:25','2023-09-04 10:01:25','',0,'https://chill-beats.com/?post_type=product&#038;p=19',-3,'product','',1);
