INSERT INTO `wp_posts` VALUES (25,1,'2023-09-02 18:59:31','2023-09-02 13:29:31','On this luxurious fleece hoodie, Umar Rashid (Frohawk Two Feathers) adds his inimitable artwork. His Artist Series series, which features his distinctive style—imagery that builds alternate historical tales and references a variety of civilizations to collapse geography and time—is \"all about flight and tenacity.\"','Jordan Artist Series','Men\'s Fleece Pullover Hoodie\r\n\r\nWork of Art in this piece by Umar like a Space shuttle crew member.\r\n<ul>\r\n 	<li>100 % Cotton</li>\r\n 	<li>4 Layered</li>\r\n 	<li>Limited Edition</li>\r\n 	<li>Soft</li>\r\n</ul>','publish','open','closed','','jordan-artist-series','','','2023-09-04 14:56:50','2023-09-04 09:26:50','',0,'https://chill-beats.com/?post_type=product&#038;p=25',-2,'product','',0);
